import React, { Component } from "react";
import moduleName from "../../components/collection-preview/collection-preview.component";
import SHOP_DATA from "./shop-data";

class Shop extends Component {
  constructor(props) {
    super(props);
    this.state = { SHOP_DATA };
  }
  render() {
    return <div>{this.state.SHOP_DATA.map((item) => console.log(item))}</div>;
  }
}

export default Shop;
